I apologize for the confusion. To simplify the code and make it more readable, you can create a helper function that takes the `spawn_enemy` or `spawn_enemy_inversion` method as an argument along with the enemy type and count. Here's the modified code:

```python
def spawn_new_enemy(self):
    def spawn_enemy_helper(spawn_method, enemy_type, count):
        threads.append(threading.Thread(target=spawn_method, args=(enemy_type, count)))

    threads = []
    if self.current_wave == 1:
        spawn_enemy_helper(self.spawn_enemy, EnemyType1, 2)
        spawn_enemy_helper(self.spawn_enemy_inversion, EnemyType1, 3)
        spawn_enemy_helper(self.spawn_enemy, EnemyType2, 5)
    elif self.current_wave == 2:
        spawn_enemy_helper(self.spawn_enemy, EnemyType2, 10)
        spawn_enemy_helper(self.spawn_enemy, EnemyType1, 2)
        spawn_enemy_helper(self.spawn_enemy_inversion, EnemyType1, 4)

    for thread in threads:
        thread.start()

    for thread in threads:
        thread.join()
```

